package digests

import (
	"encoding/json"
	"fmt"
	"testing"

	"github.com/ion-channel/ionic/scanner"
	"github.com/ion-channel/ionic/scans"
	"github.com/ion-channel/ionic/vulnerabilities"

	"github.com/franela/goblin"
	. "github.com/onsi/gomega"
)

func TestVulnerabilitiesDigests(t *testing.T) {
	g := goblin.Goblin(t)
	RegisterFailHandler(func(m string, _ ...int) { g.Fail(m) })

	g.Describe("Vulnerabilities", func() {

		g.It("should produce digests with large set of input", func() {
			s := &scanner.ScanStatus{}
			s.Status = scanner.AnalysisStatusFinished
			e := scans.NewEval()

			vs := []scans.VulnerabilityResultsVulnerability{}
			for i := 0; i < 1000; i++ {
				vs = append(vs, scans.VulnerabilityResultsVulnerability{
					Vulnerability: vulnerabilities.Vulnerability{
						ExternalID: fmt.Sprintf("EID%d", i),
					},
				})
			}

			vp := []scans.VulnerabilityResultsProduct{
				scans.VulnerabilityResultsProduct{
					Name:            "product",
					Vulnerabilities: vs,
				},
				scans.VulnerabilityResultsProduct{
					Name:            "product2",
					Vulnerabilities: []scans.VulnerabilityResultsVulnerability{},
				},
			}

			r := scans.VulnerabilityResults{
				Vulnerabilities: vp,
				Meta: struct {
					VulnerabilityCount int    "json:\"vulnerability_count\" xml:\"vulnerability_count\""
					ResolvedTo         string "json:\"resolved_to\" xml:\"resolved_to\""
				}{
					VulnerabilityCount: 1000,
				},
			}

			e.TranslatedResults = &scans.TranslatedResults{
				Type: "vulnerability",
				Data: r,
			}

			ds, err := vulnerabilityDigests(s, e)
			Expect(err).To(BeNil())
			Expect(len(ds)).To(Equal(4))

			Expect(ds[0].Title).To(Equal("total vulnerabilities"))
			Expect(string(ds[0].Data)).To(Equal(`{"count":1000}`))
			Expect(string(ds[0].SourceData)).To(Equal(bigOle))
			Expect(ds[0].Warning).To(BeTrue())
			Expect(ds[0].Pending).To(BeFalse())
			Expect(ds[0].Errored).To(BeFalse())
		})

		g.It("should produce digests", func() {
			s := &scanner.ScanStatus{}
			s.Status = scanner.AnalysisStatusFinished
			e := scans.NewEval()

			var r scans.VulnerabilityResults
			b := []byte(validHighCriticalVulns)
			err := json.Unmarshal(b, &r)
			Expect(err).To(BeNil())

			e.TranslatedResults = &scans.TranslatedResults{
				Type: "vulnerability",
				Data: r,
			}

			ds, err := vulnerabilityDigests(s, e)
			Expect(err).To(BeNil())
			Expect(len(ds)).To(Equal(4))

			Expect(ds[0].Title).To(Equal("total vulnerabilities"))
			Expect(string(ds[0].Data)).To(Equal(`{"count":3}`))
			Expect(ds[0].Warning).To(BeTrue())
			Expect(ds[0].Pending).To(BeFalse())
			Expect(ds[0].Errored).To(BeFalse())

			Expect(ds[1].Title).To(Equal("unique vulnerabilities"))
			Expect(string(ds[1].Data)).To(Equal(`{"count":3}`))
			Expect(ds[1].Warning).To(BeTrue())
			Expect(ds[1].Pending).To(BeFalse())
			Expect(ds[1].Errored).To(BeFalse())

			Expect(ds[2].Title).To(Equal("high vulnerabilities"))
			Expect(string(ds[2].Data)).To(Equal(`{"count":2}`))
			Expect(ds[2].Pending).To(BeFalse())
			Expect(ds[2].Errored).To(BeFalse())

			Expect(ds[3].Title).To(Equal("critical vulnerability"))
			Expect(string(ds[3].Data)).To(Equal(`{"count":1}`))
			Expect(ds[3].Pending).To(BeFalse())
			Expect(ds[3].Errored).To(BeFalse())
		})

		g.It("should differentiate value counts", func() {
			s := &scanner.ScanStatus{}
			s.Status = scanner.AnalysisStatusFinished
			e := scans.NewEval()

			var r scans.VulnerabilityResults
			b := []byte(validHighVulns)
			err := json.Unmarshal(b, &r)
			Expect(err).To(BeNil())

			e.TranslatedResults = &scans.TranslatedResults{
				Type: "vulnerability",
				Data: r,
			}

			ds, err := vulnerabilityDigests(s, e)
			Expect(err).To(BeNil())
			Expect(len(ds)).To(Equal(4))

			Expect(ds[0].Title).To(Equal("total vulnerabilities"))
			Expect(string(ds[0].Data)).To(Equal(`{"count":4}`))
			Expect(ds[0].Warning).To(BeTrue())
			Expect(ds[0].Pending).To(BeFalse())
			Expect(ds[0].Errored).To(BeFalse())

			Expect(ds[1].Title).To(Equal("unique vulnerabilities"))
			Expect(string(ds[1].Data)).To(Equal(`{"count":4}`))
			Expect(ds[1].Warning).To(BeTrue())
			Expect(ds[1].Pending).To(BeFalse())
			Expect(ds[1].Errored).To(BeFalse())

			Expect(ds[2].Title).To(Equal("high vulnerabilities"))
			Expect(string(ds[2].Data)).To(Equal(`{"count":3}`))
			Expect(ds[2].Passed).To(BeFalse())
			Expect(ds[2].Pending).To(BeFalse())
			Expect(ds[2].Errored).To(BeFalse())

			Expect(ds[3].Title).To(Equal("critical vulnerabilities"))
			Expect(string(ds[3].Data)).To(Equal(`{"count":0}`))
			Expect(ds[3].Passed).To(BeTrue())
			Expect(ds[3].Pending).To(BeFalse())
			Expect(ds[3].Errored).To(BeFalse())
		})

		g.It("should differentiate value data", func() {
			s := &scanner.ScanStatus{}
			e := scans.NewEval()

			var r scans.VulnerabilityResults
			b := []byte(validHighVulns)
			err := json.Unmarshal(b, &r)
			Expect(err).To(BeNil())

			e.TranslatedResults = &scans.TranslatedResults{
				Type: "vulnerability",
				Data: r,
			}

			ds, err := vulnerabilityDigests(s, e)
			Expect(err).To(BeNil())
			Expect(len(ds)).To(Equal(4))

			Expect(ds[0].Title).To(Equal("total vulnerabilities"))
			Expect(string(ds[0].SourceData)).To(Equal(totalVulnerabilities))
			Expect(ds[0].Errored).To(BeFalse())

			Expect(ds[1].Title).To(Equal("unique vulnerabilities"))
			Expect(string(ds[1].SourceData)).To(Equal(uniqueVulnerabilities))
			Expect(ds[1].Errored).To(BeFalse())

			Expect(ds[2].Title).To(Equal("high vulnerabilities"))
			Expect(string(ds[2].SourceData)).To(Equal(highVulnerabilities))
			Expect(ds[2].Errored).To(BeFalse())

			Expect(ds[3].Title).To(Equal("critical vulnerabilities"))
			Expect(string(ds[3].SourceData)).To(Equal(`{"type":"vulnerability","data":[]}`))
			Expect(ds[3].Errored).To(BeFalse())

			j, _ := json.Marshal(&e.TranslatedResults.Data)

			Expect(string(j)).To(Equal(string(b)))
		})

		g.It("should be errored when vuln scan timeout", func() {
			var e *scans.Evaluation
			s := &scanner.ScanStatus{
				Status:  scanner.AnalysisStatusFinished,
				Message: "finished after timeout",
				Name:    "vulnerability",
			}
			v, err := vulnerabilityDigests(s, e)
			Expect(err).To(BeNil())
			Expect(v).NotTo(BeNil())
			Expect(v[0].Errored).To(Equal(true))
			Expect(v[0].Data).To(BeNil())
			Expect(v[0].SourceData).NotTo(BeNil())
			Expect(string(v[0].SourceData)).To(Equal(`{"type":"vulnerability","data":[]}`))
			Expect(v[1].Errored).To(Equal(true))
			Expect(v[1].Data).To(BeNil())
			Expect(v[1].SourceData).NotTo(BeNil())
			Expect(string(v[1].SourceData)).To(Equal(`{"type":"vulnerability","data":[]}`))
			Expect(v[2].Errored).To(Equal(true))
			Expect(v[2].Data).To(BeNil())
			Expect(v[2].SourceData).NotTo(BeNil())
			Expect(string(v[2].SourceData)).To(Equal(`{"type":"vulnerability","data":[]}`))
			Expect(v[3].Errored).To(Equal(true))
			Expect(v[3].Data).To(BeNil())
			Expect(v[3].SourceData).NotTo(BeNil())
			Expect(string(v[3].SourceData)).To(Equal(`{"type":"vulnerability","data":[]}`))
		})
	})
}

